sintesis:
El Impuesto PAIS y su incidencia en la cadena de valor;

·         El pago de deuda a los proveedores del exterior (ya no contamos con crédito disponible de nuestros proveedores);

·         El pago de nuevas importaciones, (nos resulta imperioso analizar el plazo de pago);

·         Definir un mecanismo ágil para que no se exporte el impuesto PAIS que pagan nuestros proveedores locales de insumos y materias primas.
